import React from "react";
export default function Visualizer() {
  return (
    <div className="min-h-screen p-8 text-center bg-white">
      <h2 className="text-3xl font-bold mb-6">Window Visualizer</h2>
      <p>This is where the visualizer tool will appear.</p>
    </div>
  );
}
